import logo from './logo.svg';
import './App.css';
import "bootstrap/dist/css/bootstrap.css";
import NavBar from './components/navbar';
import Counters from './components/counters';

class App extends Component {
  render() {
    return (
      <div>
      <NavBar />
      <main className="container">
          <Counters/>
        </main>
        </div>
    );
  }
}

export default App;
